Richard Rogers: Inside Out

Arts Documentary hosted by Alan Yentob, published by BBC broadcasted as part of BBC Imagine series in 2008 - English narration


Information
------------------------------

As the Royal Academy in London launches a landmark exhibition to celebrate the remarkable career of the architect Lord Richard Rogers on his 80th birthday, Imagine offers another chance to see a film tracing the career of one of Britain's leading architects, first broadcast in 2008.
Uncovering the influences that have produced some of the greatest landmarks in modern architecture, Imagine follows Rogers back to his birth place, Florence, and explores the influence of his Italian heritage.
Presented by Alan Yentob, Richard Rogers revisits some of his most famous buildings, from the Pompidou Centre in Paris and Lloyds of London to the earlier and more personal work that defined his style.
The original 2008 broadcast was 40 minutes long.

